import React from 'react';
import './styles.css';
import logo from '../../assets/images/logo.png';

const Sidebar = () => {
  return (
    <div className="sidebar">
      <img src={logo} alt="Logo" className="logo" />
      <nav>
        <ul>
          <li>Dashboard</li>
          <li>Donors</li>
          <li>Users</li>
          <li>Settings</li>
        </ul>
      </nav>
    </div>
  );
};

export default Sidebar;
